var b="url",c="03__پرونده_ها_کارشناس_حقوقی_وکیل_.html",d="generationDate",e=new Date(1760443497332.99),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="vas",s="vas2",t="vijadparvande",u="baz",v="nn",w="ne",x="neg",y="mo",z="ve",A="f",B="vparvandeha",C="h1",D="h2",E="vetelatpaye",F="vamalyatparvande",G="v",H="passf",I="loginv",J="op1",K="op2",L="op3",M="op4",N="op5",O="op6",P="op7",Q="statehoghoghi",R="statehoghoghiazparvandeha",S="page",T="packageId",U="16c88a86f36847ffb1e6cf7fd4a46aba",V="type",W="Axure:Page",X="03. پرونده ها(کارشناس حقوقی/وکیل)",Y="notes",Z="annotations",ba="fn",bb="1",bc="ownerId",bd="27fe2cb489a44872b2a836bfc3fb3417",be="label",bf="عملیات پرونده",bg="Note",bh="<p><span style=\"font-family:'Yekan Bakh FaNum Bold', 'Yekan Bakh FaNum Regular', 'Yekan Bakh FaNum', sans-serif;font-weight:700;\">به ازای هر پرونده که در لیست پرونده ها قرار دارد گزینه عملیات پرونده وجود داشته باشد</span></p>",bi="2",bj="<p><span style=\"font-family:'Yekan Bakh FaNum Bold', 'Yekan Bakh FaNum Regular', 'Yekan Bakh FaNum', sans-serif;font-weight:700;\">اکشن اقدام که زیر مجموعه عملیات پرونده می باشد بسته به نوع پرونده به فرم مربوطه هدایت گردد به عنوان مثال اگر پرونده از نوع حقوقی است کاربر باید با اکشن اقدام به فرم &quot;اقدام حقوقی&quot; هدایت گردد</span></p><p><span style=\"font-family:'Yekan Bakh FaNum Bold', 'Yekan Bakh FaNum Regular', 'Yekan Bakh FaNum', sans-serif;font-weight:700;\"><br></span></p><p><span style=\"font-family:'Yekan Bakh FaNum Bold', 'Yekan Bakh FaNum Regular', 'Yekan Bakh FaNum', sans-serif;font-weight:700;color:#F21414;\">توجه گردد؛ تا قبل از بایگانی پرونده کاربر قادر به ثبت اقدام جدید یا ویرایش هر نوع اقدام </span></p><p><span style=\"font-family:'Yekan Bakh FaNum Bold', 'Yekan Bakh FaNum Regular', 'Yekan Bakh FaNum', sans-serif;font-weight:700;color:#F21414;\">ثبت شده بر روی پرونده باشد</span></p><p><span style=\"font-family:'Yekan Bakh FaNum Bold', 'Yekan Bakh FaNum Regular', 'Yekan Bakh FaNum', sans-serif;font-weight:700;color:#F21414;\"><br></span></p><p><span style=\"font-family:'Yekan Bakh FaNum Bold', 'Yekan Bakh FaNum Regular', 'Yekan Bakh FaNum', sans-serif;font-weight:700;color:#420080;\">همچنین در صورتی که پرونده در لیست پرونده های چند کاربر قرار داشته باشد همه کاربرانی که پرونده در لیست پرونده های آنان قرار دارد قادر به ثبت هر گونه عملیات بر روی پرونده باشند تا زمانی که پرونده در وضعیت بایگانی قرار نگرفته باشد</span></p>",bk="3",bl="094e956ca0d54c86b9b1e8966efff852",bm="یادآور",bn="<p><span style=\"font-family:'Yekan Bakh FaNum Bold', 'Yekan Bakh FaNum Regular', 'Yekan Bakh FaNum', sans-serif;font-weight:700;color:#A011AC;\">یادآورهای ثبت شده توسط کاربر در بخش فعالیت در صورت محرمانه بودن تنها برای فرد ثبت کننده یادآور نمایش داده شود در غیر اینصورت به صورت عمومی برای همه کاربران نمایش داده شود</span></p>",bo="4",bp="<p><span style=\"font-family:'Yekan Bakh FaNum Bold', 'Yekan Bakh FaNum Regular', 'Yekan Bakh FaNum', sans-serif;font-weight:700;\">یادآوره های قرار داده شده بر روی پرونده در هر مرحله و از طریق هر گونه عملیات از طریق این بخش قابل مشاهده باشد.با کلیک کاربر بر روی آیکن یادآور کاربر به فرم &quot;</span><span style=\"font-family:'Yekan Bakh FaNum Bold', 'Yekan Bakh FaNum Regular', 'Yekan Bakh FaNum', sans-serif;font-weight:700;color:#333333;\">04. یادآورها(کارشناس حقوقی/وکیل)&quot; جهت مشاهده یادآورها منتقل گردد</span></p>",bq="5",br="<p><span style=\"font-family:'Yekan Bakh FaNum Bold', 'Yekan Bakh FaNum Regular', 'Yekan Bakh FaNum', sans-serif;font-weight:700;\">کاربر در هنگام ایجاد پرونده می تواند نسبت به فعال سازی یادآور بر روی جلسه اقدام نموده و یا در هنگام اقدام بر روی پرونده می تواند در صورت نیاز نسبت به فعال نمودن یادآور اقدام نماید</span></p><p><span style=\"font-family:'Yekan Bakh FaNum Bold', 'Yekan Bakh FaNum Regular', 'Yekan Bakh FaNum', sans-serif;font-weight:700;color:#E81616;\">توجه گردد در صورتی که کاربر نیاز به ثبت هرگونه یادآور خارج از محدوده ی فیلدهایی که دارای گزینه یادآور می باشد داشته باشد می تواند با استفاده از اکشن &quot;فعالیت&quot; که زیرمجموعه عملیات پرونده می باشد یک فعالیت با عنوان یادآوری ثبت نموده و نسبت به فعال سازی یادآور آن فعالیت اقدام نماید</span></p>",bs="style",bt="baseStyle",bu="627587b6038d43cca051c114ac41ad32",bv="pageAlignment",bw="center",bx="fill",by="fillType",bz="solid",bA="color",bB=0xFFFFFFFF,bC="image",bD="imageAlignment",bE="near",bF="imageRepeat",bG="auto",bH="favicon",bI="sketchFactor",bJ="0",bK="colorStyle",bL="appliedColor",bM="fontName",bN="Applied Font",bO="borderWidth",bP="borderVisibility",bQ="borderFill",bR=0xFF797979,bS="cornerRadius",bT="cornerVisibility",bU="outerShadow",bV="on",bW=false,bX="offsetX",bY=5,bZ="offsetY",ca="blurRadius",cb="spread",cc="r",cd=0,ce="g",cf="b",cg="a",ch=0.349019607843137,ci="adaptiveStyles",cj="interactionMap",ck="onLoad",cl="eventType",cm="OnPageLoad",cn="description",co="Page Loaded",cp="cases",cq="Case 1",cr="conditionString",cs="if value of loginv equals &quot;1&quot;",ct="isNewIfGroup",cu="caseColorHex",cv="AB68FF",cw="condition",cx="exprType",cy="binaryOp",cz="op",cA="==",cB="leftExpr",cC="fcall",cD="functionName",cE="GetGlobalVariableValue",cF="arguments",cG="globalVariableLiteral",cH="variableName",cI="rightExpr",cJ="stringLiteral",cK="value",cL="stos",cM="actions",cN="action",cO="setPanelState",cP="Set p03 to&nbsp; to State2 ",cQ="displayName",cR="Set Panel State",cS="actionInfoDescriptions",cT="p03 to State2",cU="Set p03 to  to State2 ",cV="panelsToStates",cW="panelPath",cX="91bbfdd730f54cbab3ae5b4f5f93af5c",cY="stateInfo",cZ="setStateType",da="diagram",db="stateNumber",dc=2,dd="stateValue",de="loop",df="showWhenSet",dg="options",dh="compress",di="objects",dj="id",dk="p03",dl="friendlyType",dm="Dynamic Panel",dn="dynamicPanel",dp="styleType",dq="visible",dr=true,ds=1788,dt=871,du="imageOverrides",dv="scrollbars",dw="none",dx="fitToContent",dy="propagate",dz="diagrams",dA="768d30c5ad9a4af2a71f502c08d695cd",dB="State1",dC="Axure:PanelDiagram",dD=0xFFFFFF,dE